import React, { useEffect, useRef, useState } from 'react';
import Navbar from './Navbar';
import './Home.css';

export default function Home() {
  const [showElements, setShowElements] = useState({
    leftColumn: false,
    rightColumn: false,
    benchmarkText: false,
    benchmarkImage: false
  });

  const leftColumnRef = useRef(null);
  const rightColumnRef = useRef(null);
  const benchmarkTextRef = useRef(null);
  const benchmarkImageRef = useRef(null);

  useEffect(() => {
    const handleScroll = () => {
      const leftPos = leftColumnRef.current?.getBoundingClientRect().top;
      const rightPos = rightColumnRef.current?.getBoundingClientRect().top;
      const textPos = benchmarkTextRef.current?.getBoundingClientRect().top;
      const imgPos = benchmarkImageRef.current?.getBoundingClientRect().top;

      const windowHeight = window.innerHeight;

      // Detect if the elements are in view
      if (leftPos < windowHeight - 100) setShowElements((prev) => ({ ...prev, leftColumn: true }));
      if (rightPos < windowHeight - 100) setShowElements((prev) => ({ ...prev, rightColumn: true }));
      if (textPos < windowHeight - 100) setShowElements((prev) => ({ ...prev, benchmarkText: true }));
      if (imgPos < windowHeight - 100) setShowElements((prev) => ({ ...prev, benchmarkImage: true }));
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div>
      <Navbar />
      <div className="container home-content" style={{ marginTop: '80px' }}>
        <div className="row align-items-center">
          {/* Left Column */}
          <div
            className={`col-md-6 fade-in ${showElements.leftColumn ? 'show' : ''}`}
            ref={leftColumnRef}
          >
            <h1 className="hero-title text-start">Your Personal</h1>
            <h1 className="hero-title text-start">AI Health Assistant</h1>
            <p className="hero-subtitle text-start">
              Now say goodbye to Google scares! <br />Available for FREE, 24x7 on WhatsApp.
            </p>
          </div>

          {/* Right Column */}
          <div
            className={`col-md-6 slide-in-right ${showElements.rightColumn ? 'show' : ''}`}
            ref={rightColumnRef}
          >
            <div className="row">
              <img
                src="https://framerusercontent.com/images/nGcJ6ehPV480HX0NhIEWmaNP4.png?scale-down-to=1024"
                alt="AI Assistant"
                className="img-fluid"
              />
            </div>

            {/* Centered Button */}
            <div className="row mt-4">
              <div className="d-flex justify-content-center">
                <button
                  className="rounded-pill bg-success text-center d-flex justify-content-center align-items-center py-2 px-2"
                  style={{ width: '150px', fontSize: '20px' , fontFamily: 'sans-serif', border: 'none'}}
                >
                  Talk to August
                </button>
              </div>
            </div>
          </div>
        </div>

        {/* Benchmark Section */}
        <div className="row benchmark-section">
          <div className="col-sm-8">
            <div className="row my-5" ref={benchmarkImageRef} style={{ marginRight: '250px' }}>
              <img
                src="https://framerusercontent.com/images/79EemWgLilNo6mcb2E2TaQADkAY.png"
                alt=""
                className={`benchmark-image fade-in ${showElements.benchmarkImage ? 'show' : ''}`}
              />
            </div>
          </div>
          <div className="col-sm-4">
            <div className="row my-5" ref={benchmarkTextRef}>
              <div className={`row-sm-4 text-start benchmark-text slide-in-left ${showElements.benchmarkText ? 'show' : ''}`} style={{fontSize:'20px'}}>Successful Benchmarking</div>
              <div className="row-sm-4 text-start" style={{fontSize: '40px', fontFamily: 'sans-serif'}}>August is the <br /> top Health AI <br />in the world</div>
              <div className="row-sm-4">We scored 94.8% in the US Medical Licensing Examination. This is one of the standard benchmarks used for Health AIs. Check the image to see how August compares.</div>
              <div className="row-sm-4">first</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
